import "./Write.css";

const Write = () => {
  return (
    <div className="write">
      <form action="" className="writeForm">
        <div className="writeFormGroup">
          <input type="file" id="fileInput" />
          <input type="text " />
        </div>
      </form>
    </div>
  );
};

export default Write;
